import KeyboardArrowRightIcon from '@material-ui/icons/KeyboardArrowRight';
import Button from '@material-ui/core/Button'
import Typography from '@material-ui/core/Typography'
import { makeStyles, TextField } from '@material-ui/core';
import { fontStyle } from '@mui/system';


const UseStyles = makeStyles({
  btn: {
   marginTop:20,
    fontSize: 16,
    '&:hover':{
      backgroundColor:'violet'
    }
  },

  field:{

    marginTop:20,
    marginBottom:20,
    display:'block'
  }
})

const Create = () => {
  const classes = UseStyles()

  return (

    <Container>

      <Typography 
         variant="h6"
        component='h1'
        color="TextSecondary"
        gutterBottom
      >
        Create Notes page
      </Typography>

      <form noValidate autoComplete='off'>
        <TextField 
        className={classes.field}
        label='Note Title'
        variant="outlined"
        color="seconday"
        fullWidth
        required
        />

<TextField 
        className={classes.field}
        label='Details'
        variant="outlined"
        color="seconday"
        fullWidth
        required
        multiline

        />



      </form>


      <Button
        className={classes.btn}
        onClick={() => { console.warn("I got clicked") }}

        variant="contained"
        color="secondary"
        //   startIcon={ < SendIcon />}
        endIcon={< KeyboardArrowRightIcon />}
      >
        Send
      </Button>

    </Container>
  )
}

export default Create
